import React from "react";

const MovieItem = ({ movie }) => {
  return (
    <div className="movie">
      <div className="">
        {new Date(movie.createdAt).toLocaleString("en-US")}
      </div>
      <img src={movie.image} alt={movie.image} />
      <h2>{movie.title}</h2>
    </div>
  );
};

export default MovieItem;
